Tornado Valley (2009)


CastCameron Bancroft, Meredith Monroe, Shaun Benson, Duncan Fraser, Pascale Hutton 

Toen Liz negen jaar oud was, verloor ze haar moeder toen een tornado hun huis vernietigde. Nu, 25 jaar later, is Liz meteoroloog, met als specialisme het opsporen van tornado's. Samen met haar man Matt, met wie ze in scheiding ligt, heeft ze een systeem ontworpen om tornado's in een vroeg stadium op te sporen. Zo hoopt ze anderen het leed te besparen dat haar op jonge leeftijd tekende. Wanneer hun Phased Array Radar System wordt aangezet, krijgt Liz de schrik van haar leven: er is een reusachtige tornado op komst? en hij komt recht op Liz' huis af, waar haar dochtertje en zus verblijven. Zijn Liz en Matt op tijd om hen te redden?

